import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
        paddingHorizontal: 10,
    },
    search: {
        marginTop: 25,
        borderWidth: 1,
        borderColor: '#ABABAB'
    },
    icon: {
        color: '#ABABAB'
    },
    userdate: {
        flexDirection: 'row',
    },
    hour: {
        marginLeft: 10,
        color: "#A1A1A1"
    },
    number: {
        color: '#fff',
        backgroundColor: '#7159c1',
        borderRadius: 28,
        borderWidth: 4,
        borderColor: '#7159c1',
        textAlign: 'center',
        height: 18,
        fontSize: 12,
        marginRight:  20,
        marginBottom: 30,
    },
});
